@welikalaa Can it surpass being in full kit announcing a curfew --- for War on Pandemic?
#SriLanka: Amid a surge in #Covid_19 cases, the curfew in the Western Province is being extended until November 9, 
Army Commander Lt. Gen. Shavendra Silva announces on television https://t.co/cakKthcXvp

@DrTedros But some leaders can't respect others rights.Barriers there
In #SriLanka Why cremation is the only one  solution for #Covid_19 deaths. #WHO guidelines why couldn't follow by government. Burial also we can do.
Why can't @DrTedros @WHOSriLanka @WHO @hrw please consider the message.

